import React from 'react';
import { Link } from 'react-router-dom';
import Header from '../components/Header';  // Add this import
import Footer from '../components/Footer';  // Add this import

const faqItems = [
  { id: 'change-booking', question: 'How do I change my booking?' },
  { id: 'refund', question: 'How do I request a refund?' },
  // Add more FAQ items here
];

export default function FAQPage() {
  return (
    <>
      <Header />
      <main className="max-w-3xl mx-auto py-10 px-4 text-gray-800">
        <h1 className="text-3xl font-bold mb-6">Help Center</h1>
        <ul className="space-y-4">
          {faqItems.map((item) => (
            <li key={item.id}>
              <Link
                to={`/faq/${item.id}`}
                className="w-full py-3 px-5 bg-blue-600 text-white font-semibold rounded-lg hover:bg-blue-700 transition duration-300"
              >
                {item.question}
              </Link>
            </li>
          ))}
        </ul>
      </main>
      <Footer />
    </>
  );
}
